import React from 'react'
import burgerLogo from '../../assets/images/burger-logo.png'
import classes from './Logo.module.css'

const logo = (props) => (
    <div>
        <img className={classes.Logo} src={burgerLogo} alt="MyBurger"></img>
    </div>
);

export default logo;
